function drawBoundingBox(n,t){var r=document.getElementById(n),i=r.getContext("2d");t.forEach(function(n){i.strokeStyle="red";i.beginPath();i.moveTo(n.x1*320/1024,n.y1*240/768);i.lineTo(n.x2*320/1024,n.y1*240/768);i.lineTo(n.x2*320/1024,n.y2*240/768);i.lineTo(n.x1*320/1024,n.y2*240/768);i.lineTo(n.x1*320/1024,n.y1*240/768);i.stroke()})}